Vector2f sample_dielectric_GGX(float wo_dot_normal, float roughness, float specularity) {
    float specularity_t = (specularity - 0.0125f) / 0.2375f; // Remap valid specularity values to [0, 1]
    return Math::ImageSampling::trilinear(dielectric_GGX,
        dielectric_GGX_angle_sample_count, dielectric_GGX_roughness_sample_count, dielectric_GGX_specularity_sample_count,
        wo_dot_normal, roughness, specularity_t);
}

